[[File:Bird house trapping.png|thumb|300px|A bird house trap that has been set.]]
'''Bird house trapping''' is a [[Hunter]] technique that is used to catch birds. With this technique the player sets up bird houses on [[Fossil Island]] and fills them with seeds. The player then has to wait [[RuneScape clock|around fifty minutes]] for the bird houses to passively fill with birds.

==Bird houses==
Bird house traps are made using the [[Crafting]] skill requiring [[Woodcutting#Types_of_trees|logs]] and a piece of [[clockwork]] with a [[hammer]] and [[chisel]]. They are then placed in designated spots on [[Fossil Island]] to catch birds, providing a passive method of training Hunter and gaining resources.

Additionally, [[Ironman Mode|Ironmen]] will need a [[Construction]] level of 25 to build a [[crafting table 2]] for assembling clockwork.

{{/Table}}

==Seeds==

To arm the trap, players need 10 low level [[hop seed]]s or [[herb seeds]] ([[Krandorian seed|Krandorian]]/[[Harralander seed|Harralander]] or lower) or 5 high level seeds ([[Wildblood seed|Wildblood]]/[[Rannar seed|Ranarr]] or above). All seeds give the exact same rewards{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1019209471015387138|date=17 July 2018|archiveurl=https://archive.is/YvWnh|archivedate=27 May 2020|quote=[Do the seeds you place in birdhouses have an effect on the amount of nests you get?] No.|name=ashseedstweet}}, so it is recommended to use the seeds that are cheapest or easiest to obtain.

{{/Seeds}}

==Locations==
{{Map|width=300|height=300|3677,3882|3678,3815|3763,3755|3768,3761|align=right|mtype=pin}}
There are four spots on [[Fossil Island]] in which players can place bird house traps, indicated by the [[File:Bird house site icon.png]] icon.
*The first and second are found in the [[Verdant Valley]], south of the [[Museum Camp]].
*The third is found west of the [[ancient shroom]] in the [[Mushroom Forest]], and directly north of the [[Magic Mushtree|magic mushtree]].
*The fourth is found by the entrance to the [[Tar Swamp]].

All of these spots are easily accessible by using the [[Digsite pendant]] teleport to Fossil Island after using the pendant on the strange machine at the [[House on the Hill]], then using the magic mushtree in the House on the Hill.

==Catching birds==
Once the bird house trap has been set and filled with seeds, it will passively capture birds at random tick intervals (an average of once every 5 minutes), up to a maximum of 10. To claim the Hunter experience and loot, players must return to the bird house trap to empty and dismantle it. The bird house will be lost in the process, but the clockwork will be returned, meaning players only need four clockworks to set all their bird houses indefinitely, after which they will only need to bring hammer, chisel, logs, and seeds. However, it is recommended to take a fifth clockwork to craft birdhouses while moving between sites for efficiency.

Alternatively, players may purchase pre-made birdhouses from the Grand Exchange. Retrieving these will still return the clockwork, which players can sell afterward.

