===Other nests===
The nest table will be rolled 10 times. The chance of a successful roll is based on both type of birdhouse and Hunter level, with more nests provided with a higher Hunter level and on higher tier birdhouses{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1136339797952389122|date=5 June 2019|archiveurl=https://archive.is/prWZu|archivedate=10 June 2021|quote=You get 1 roll for a seed nest, with a chance of 0% at level 1 and 78.5% at level 99. Then you get 10 rolls for more nests. Their chances at level 99 are 10.0%, 12.5%, 12.8%, 13.0%, 14.0%, 15.0%, 16.0%, 17.0% and 17.5% for the wood tiers. These scale down by half at level 50.}}
. The rate is constant at levels below 50. Boosting above 99 will increase the expected number of nests per birdhouse. {{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1418868591345156114|date=24 July 2021|archiveurl=https://archive.is/yB5Dv|archivedate=6 August 2021|quote=I believe it does help with the total quantity of egg/ring/empty nests. It does not make you more likely to get the seed nest.}} <!-- See talk page for guess at pseudocode -->
