====Pre-roll clue nests====
{{Incomplete|Clue nest mechanics are not confirmed. The chance of receiving clues may also be based on [[Hunter]] level.}}
After a successful roll for the other nest table, an additional series of rolls is performed for clue nests. It is possible to obtain multiple clues from the same birdhouse, but once at least one clue has been awarded, further rolls do not attempt to give clues. Completing tiers of [[Combat Achievements]] will increase the rate of receiving [[Clue nest (easy)|easy]], [[Clue nest (medium)|medium]], [[Clue nest (hard)|hard]], and [[Clue nest (elite)|elite]] clue nests. Clues are not awarded if the player already has a clue of that level.

